const Footer = () => (
  <footer className="footer">
    <div className="designed-by">
      <p>Designed & Built by Woo Young Choi</p>
    </div>
    <style jsx>{`
      .footer {
        display: flex;
        position: fixed;
        bottom: 0;
        width: 100%;
        background-color: #000;
        overflow: auto;
        color: #fff;
        padding: 0;
        justify-content: flex-end;
        z-index: 0;
      }
      p {
        color: white;
      }
      @media screen and (min-width: 60.0625rem) .footer {
        min-height: 100vh;
      }
    `}</style>
  </footer>
);

const Contact = () => (
  <>
    <section className="contact">
      <div className="contact--details">
        <h1>Contact</h1>
        <p>
          Have any questions? Let's talk! I am always open for new opportunities
          and friendships!
        </p>
      </div>
      <button className="btn">CALL TO ACTION</button>
    </section>
    <Footer />
    <style jsx>
      {`
        .contact {
          display: block;
          text-align: center;
          margin-top: 230px;
          margin-bottom: 200px;
        }
        .btn {
          font-size: 15px;
          padding: 10px;
          margin-top: 50px;
        }
      `}
    </style>
  </>
);

export default Contact;
